	('839d5755-1883-43c6-81f6-5e1efb9cd0a5', '2be6c594-dbff-4f4e-9e2e-72368025ad25', 'Who is jeanne ? ', 'Jeanne is the main character in the story "Une vie" by Guy de Maupassant. She is a young girl who has just left the convent, finally free to embrace the joys of life that she has been dreaming about for a long time. Jeanne is depicted as being curious, eager for happiness, and ready to experience all the charming encounters and adventures that life has in store for her. Throughout the story, we see her transitioning from a sheltered life to one filled with promise and possibilities.', '2024-02-21 06:30:41.628241', '2db343ed-f650-4e3c-a527-db7829829bee', NULL, '{"sources": [{"name": "Maupassant_Une_vie.pdf", "type": "file", "source_url": "http://host.docker.internal:54321/storage/v1/object/sign/quivr/2db343ed-f650-4e3c-a527-db7829829bee/Maupassant_Une_vie.pdf?token=eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1cmwiOiJxdWl2ci8yZGIzNDNlZC1mNjUwLTRlM2MtYTUyNy1kYjc4Mjk4MjliZWUvTWF1cGFzc2FudF9VbmVfdmllLnBkZiIsImlhdCI6MTcwODQ5NzA0NiwiZXhwIjoxNzA4NTAwNjQ2fQ.QqbmbAtpANw8Gd5X31CqN8PYTenvUDE-_-Enva8frlY", "original_file_name": "Maupassant_Une_vie.pdf"}, {"name": "Maupassant_Une_vie.pdf", "type": "file", "source_url": "http://host.docker.internal:54321/storage/v1/object/sign/quivr/2db343ed-f650-4e3c-a527-db7829829bee/Maupassant_Une_vie.pdf?token=eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1cmwiOiJxdWl2ci8yZGIzNDNlZC1mNjUwLTRlM2MtYTUyNy1kYjc4Mjk4MjliZWUvTWF1cGFzc2FudF9VbmVfdmllLnBkZiIsImlhdCI6MTcwODQ5NzA0NiwiZXhwIjoxNzA4NTAwNjQ2fQ.QqbmbAtpANw8Gd5X31CqN8PYTenvUDE-_-Enva8frlY", "original_file_name": "Maupassant_Une_vie.pdf"}, {"name": "Maupassant_Une_vie.pdf", "type": "file", "source_url": "http://host.docker.internal:54321/storage/v1/object/sign/quivr/2db343ed-f650-4e3c-a527-db7829829bee/Maupassant_Une_vie.pdf?token=eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1cmwiOiJxdWl2ci8yZGIzNDNlZC1mNjUwLTRlM2MtYTUyNy1kYjc4Mjk4MjliZWUvTWF1cGFzc2FudF9VbmVfdmllLnBkZiIsImlhdCI6MTcwODQ5NzA0NiwiZXhwIjoxNzA4N