Quivr is an open-source chat-powered second brain platform founded by three French individuals with diverse backgrounds in engineering, sales, and open-source development. They possess expertise in growing companies, increasing revenue, and frontend technologies like Angular, NextJS, CSS, SCSS, and Javascript.

**Key Features:**

- Quivr is an open-source RAG framework with over 27,000 Github stars.
- It is connected to companies'' data, with Disney utilizing it to deploy an HR chatbot for their employees.
- Quivr serves as an AI open-source platform where enterprises can connect to their tools, documents, APIs, and databases to engage in chat interactions.', '2024-02-21 16:46:00.852187', 'a2ba3d61-044f-45dc-9104-22b35c3f9bcc', NULL, NULL, NULL),
	('dc68c1e1-f171-432b-beb6-41ee872508f8', 'a44f4808-55ee-4c35-9551-42a281fcc119', 'What is quivr ? ', '**Quivr Overview:**

