	('b8951c94-35f2-448f-8393-3264130e2bb1', '9e65e944-b957-4cb5-9faf-aeaebbe1c469', 'What is quivr ? ', '**Quivr Overview:**

Quivr is an open-source chat-powered second brain platform founded by three French individuals with backgrounds in engineering, sales, and DevOps. They have experience in growing companies, increasing GMV, and leading thought leadership in web development. Quivr aims to help companies with over 100 employees who have issues finding information. They are also Github power users and have expertise in frontend technologies like Angular, NextJS, and Typescript.

**Key Features:**

- Quivr is an open-source RAG framework with 27k+ Github stars.
- It is connected to companies'' data and can be used for various purposes.
- For instance, Disney utilizes Quivr to deploy an HR chatbot for their employees.
- Quivr serves as an AI open-source platform where enterprises can connect to their tools, documents, APIs, and databases to interact via chat.', '2024-02-22 19:30:33.233092', 'a2ba3d61-044f-45dc-9104-22b35c3f9bcc', NULL, NULL, NULL),
