	('c3ac7f29-896b-40a9-9a0c-b170de1f8048', 'c903ed0c-454f-4aac-a993-c6db10fc3507', 'What is quivr ? ', '**Quivr Overview:**

Quivr is an open-source chat-powered second brain platform founded by three French individuals with diverse backgrounds in engineering, sales, and DevOps. They possess expertise in frontend technologies like Angular, NextJS, CSS, SCSS, and Javascript. Additionally, they are proficient Github power users with a strong sales understanding.

**Key Features of Quivr:**

- Open-source RAG framework with over 27k Github stars.
- Connected to companies'' data, with Disney utilizing it to deploy an HR chatbot for their employees.
- An AI open-source platform enabling enterprises to connect to their tools, documents, APIs, and databases for seamless communication.', '2024-02-22 19:49:26.942197', 'a2ba3d61-044f-45dc-9104-22b35c3f9bcc', NULL, NULL, NULL),
