By following these steps, you can effectively communicate with Quivr''s telemetry to gather and analyze the desired data.', '2024-02-23 18:01:47.93915', '2db343ed-f650-4e3c-a527-db7829829bee', NULL, '{"sources": [{"name": "How to use Quivr to talk to Quivrs Telemetry.pdf", "type": "file", "source_url": "http://host.docker.internal:54321/storage/v1/object/sign/quivr/2db343ed-f650-4e3c-a527-db7829829bee/How to use Quivr to talk to Quivrs Telemetry.pdf?token=eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1cmwiOiJxdWl2ci8yZGIzNDNlZC1mNjUwLTRlM2MtYTUyNy1kYjc4Mjk4MjliZWUvSG93IHRvIHVzZSBRdWl2ciB0byB0YWxrIHRvIFF1aXZycyBUZWxlbWV0cnkucGRmIiwiaWF0IjoxNzA4NzExMzIyLCJleHAiOjE3MDg3MTQ5MjJ9.vQnvnLNprwWXo908fBDRwh45m6nERO-OUbGFJ8LwKyI", "original_file_name": "How to use Quivr to talk to Quivrs Telemetry.pdf"}]}', NULL),
	('836491d9-9294-4069-abd8-98315196bb28', '572d96ce-532f-4755-a626-dcbab482461b', 'Summarize the conversation so I can send an email to my boss with the results', 'Certainly! Here''s a concise summary suitable for an email:

