	('33f1b62a-db46-414a-bcb1-bd6ec260ec77', 'b70b2013-7b91-4dd6-b042-9e63825a83be', 'How many unique users per day on the telemetry of Quivr?', 'Response: The query shows the number of unique users per day on the telemetry of Quivr. It appears that there were 22 unique users on February 8, 2024, 33 on February 9, 33 on February 10, 43 on February 11, 49 on February 12, 51 on February 13, 46 on February 14, 55 on February 15, 34 on February 16, 48 on February 17, 37 on February 18, 53 on February 19, 52 on February 20, 75 on February 21, 67 on February 22, and 66 on February 23. 

